import styled from "styled-components";
import { motion } from "framer-motion";

const DashbordPostStyle = styled(motion.div)`
  position: absolute;
  margin-top: 50px;
  top: 0;
  left: 0;
  z-index: 100;
  height: auto;
  width: auto;
  background-color: #191919;
  .titles {
    position: relative;
    width: auto;
    height: auto;
    display: flex;
    flex-wrap: nowrap;
    * {
      color: #f8f8ff;
    }
    .article {
      display: flex;
      width: 30vw;
    }
    .status {
      width: 10vw;
      background-color: hotpink;
    }
  }
`;
const DashbordPost = ({ controller }) => {
  return (
    <DashbordPostStyle animate={controller}>
      <div className="titles">
        <span className="article">Articles</span>
        <span className="status">active</span>
        <span className="payment">Payment</span>
      </div>
      {[1, 1, 1, , 1, 1, 1, 1, 1].map((e, i) => {
        return (
          <div className="content">
            <div className="cover" />
            <span className="title">
              Tokyo Fashion Week Is Making Itself Great Again
            </span>
          </div>
        );
      })}
    </DashbordPostStyle>
  );
};
export default DashbordPost;
